import classNames from "classnames";
import { useState } from "react";
export const ReviewDialog = ({ ReviewCallback, cancelDelete, text, review }) => {
  const [loading, setLoading] = useState(review);
  if (loading) {
    return (
      <div className="fxc popup-backdrop">
        <span
          aria-label="Loading"
          className="text-white cfi-large cfi cfi-circle-loader"
        />
      </div>
    );

  }

};
